function headerTitle() {
  const headers = [
    "Inflation projection",
    "Unit Rate",
    "Mileage (km)",
    "Service Fee ($)",
    "Lease Fee ($)",
    "Grand Total ($)",
    "About ($)",
  ];

  return headers;
}

export default headerTitle;
